        <script>
            
var eye = -1;
var closing = true;
$(document).ready(function() {
    $("body").on("click",".color",function() {
        var id = $(this).attr("id");
        id = id.substr(2);
        $(".eyeColor").css("background-color","#"+id);
    });
    show();
});
function show() {
    if (closing) {
        eye++;
        if (eye>3) {
            eye = 2;
            closing = false;
        }
    } else {
        eye--;
        if (eye<0) {
            eye = 0;
            closing = true;
        }
    }
    $("#eyes g").hide();
    $("#eye_"+eye).show();
    setTimeout(show,eye===0?1000:120);
}

        </script>
